import React,{ Component } from 'react';
class Form1 extends Component
{
    constructor(props)
    {
        super(props)
        this.handleSubmit=this.handleSubmit.bind(this)
        this.handleChange=this.handleChange.bind(this)
        this.state={
              employeeForm:{
                  firstname:'',
                  username:'',
                  password:''
              }
        }
        console.log(this.state.employeeForm)
    }

    handleSubmit()
    {
       var data={firstname:this.state.firstName,username:this.state.username,password:this.state.password}
       //axios.post('http://localhost:8080/api/insertstudent', person);
       console.log(data);
    }
    handleChange(e)
    {   
        console.log(" data ",e.target.name," ",e.target.value)
        this.setState({
            [e.target.name]:e.target.value
        })
    }

    render(){
        return(
            <div>
             <form onSubmit={this.handleSubmit} method="post">
                 <label> firstname
                 <input type="text" name="firstname"  
                               onChange={this.handleChange} id="firstName"/></label>
                   <br/><br/>   
                   <label> username
                 <input type="text" name="username" 
                               onChange={this.handleChange} id="username"/></label>
                    <br/><br/> 
                    <label> password
                 <input type="text" name="password" 
                               onChange={this.handleChange} id="password"/></label>

                    <br/><br/>
                    <button type="submit">submit</button>           
                 </form>
            </div>
        )
    }

}
export default Form1
